import React from 'react'

class DataComp extends React.Component {
	state= {
		id: "",
		name: ""
	}

	componentDidUpdate(prevProps) {
    if(this.props.data !== prevProps.data && this.props.data !== false) {
			let keys = Object.keys(this.props.data[0])
			this.setState({ id: keys[0]})
			this.setState({ name: keys[1]})
    }

	}

	renderData = (data, id, name) => {
		return data.map((data) => {
			return (
				<li key={data[id]}>{data[id]} : {data[name]} 
					<button onClick={() => { 
            this.props.setID("ZoneId", data[id])
            this.props.getCategoryData(data[id]) 
            }}>Go
          </button>
				</li>
			)	
		})	
	}

	render() {
		console.log("DataComp mounted")
		return (
			<div>
				<h3>{this.props.name}:</h3>
        {this.props.data && this.renderData(this.props.data, this.state.id, this.state.name)}
      </div>

		)
	}
}

export default DataComp
